import React, { useState } from 'react';
import { render } from 'react-dom';

import TimeRange from '../../components/TimelineSlider/App';
import { set } from 'date-fns';

const Split = () => {
  const now = new Date();
  const getTodayAtSpecificHour = (hour = 24) =>
    set(now, { hours: hour, minutes: 0, seconds: 0, milliseconds: 0 });

  return (
    <div>
      <div
        style={{
          width: '80vw',
          /* height: '80vh', */
          margin: '24px auto',
          background: '#fff',
          borderRadius: '20px',
        }}
      >
        캔버스 영역
      </div>
      <div
        style={{
          padding: '16px',
          /* height: '20vh', */
          background: '#fff',
          overflowX: 'scroll',
        }}
      >
        <TimeRange />
      </div>
    </div>
  );
};

export default Split;
